  [],\n\t\"revision_timestamp\": \"2016-04-06T23:20:25.152204\",\n\t\"name\": \"insurance-coverage-and-whither-thou-goest-for-health-info\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Authors of Insurance Coverage and Whither
  Thou Goest for Health Information in 2012, recently published in Volume 4, Issue
  4 of the Medicare and Medicaid Research Review, report that in 2012 a majority of
  adult respondents preferred offline to online (Internet) health information sources
  no matter the type of health insurance, i.e., private, public (Medicare-Medicaid),
  or uninsured. This study used a Pew Charitable Trust survey of a nationally representative,
  random sample of 3,014 adult U.S. residents to examine their use of the Internet
  and mHealth (mobile health) technologies across insurance types. The report finds
  that most self-reported Internet users seek health information and privately insured
  respondents (compared with other insurance types) are more likely to use new technologies.
  Medicaid beneficiaries are more likely than the privately insured to share health
  information online and Medicare beneficiaries are more likely than the privately
  insured to text with health professionals. Future increases in out-of-pocket medical
  costs may drive consumers toward these generally free electronic health tools.</p>n\",\n\t\"license_title\":
